import { useState } from "react";
import elephant1 from '../assets/elephant-1.jpeg'
import elephant2 from '../assets/elephant-2.jpeg'
import elephant3 from '../assets/elephant-3.jpeg'

function Users(){
    const [employeeObj,setEmployeeObj]= useState([
        {
            title: "elephant-1",
            text: "Awesome Elepant -1",
            image: elephant1
        },
        {
            title: "elephant-2",
            text: "Awesome Elepant -2",
            image: elephant2
        },
        {
            title: "elephant-3",
            text: "Awesome Elepant -3",
            image: elephant3
        }
    ])


    function handleUseStates(e){
        e.preventDefault();
        someName="2"
        setEmployeeObj("2")
    } 

    return(
        <>
            {someName}
            <br/>
            {employeeObj}
            <button onClick={handleUseStates}> ClickMe</button>
        </>
    )

}

export default Users;
